import "./estilos.css"
import { Link } from "react-router-dom"

const CartWidget = () => {
    return (
        <Link to="/cart">
        <span className="material-icons">shopping_cart</span>
        <h1>Example heading <span class="badge badge-secondary">New</span></h1>
        </Link>
        
     )
}

export default CartWidget
